This tutorial expects you to have followed the Kani installation instructions first. Kani is unlike the testing tools you may already be familiar with. Much of testing is concerned with thinking of new corner cases that need to be covered. With Kani, all the corner cases are covered from the start, and the new concern is narrowing down the scope to something manageable for the checker. Consider this first program (which can be found under docs/src/tutorial/kani-first-steps ): fn estimate_size(x: u32) -> u32 { if x < 256 { if x < 128 { return 1; } else { return 3; } } else if x < 1024 { if x > 1022 { panic!("Oh no, a failing corner case!"); } else { return 5; } } else { if x < 2048 { return 7; } else { return 9; } }
} Think about the test harness you would need to write to test this function. You would need figure out a whole set of arguments to call the function with that would exercise each branch. You would need to keep that test harness up-to-date with the code, in case some of the branches change. And if this function was more complicated—for example, if some of the branches depended on global state—the test harness would be even more onerous to write. We can try to property test a function like this, but if we're naive about it (and consider all possible u32 inputs), then it's unlikely we'll ever find the bug. proptest! { #![proptest_config(ProptestConfig::with_cases(10000))] #[test] fn doesnt_crash(x: u32) { estimate_size(x); } } # cargo test
[...]
test tests::doesnt_crash ... ok There's only 1 in 4 billion inputs that fail, so it's vanishingly unlikely the property test will find it, even with a million samples. With Kani, however: #[cfg(kani)]
#[no_mangle]
fn main() { let x: u32 = kani::any(); estimate_size(x);
} # cargo kani
[...]
Runtime decision procedure: 0.00116886s ** Results:
./src/lib.rs function estimate_size
[estimate_size.assertion.1] line 9 Oh no, a failing corner case!: FAILURE ** 1 of 1 failed (2 iterations)
VERIFICATION FAILED Kani has immediately found a failure. Notably, we haven't had to write explicit assertions in our "proof harness": by default, Kani will find a host of erroneous conditions which include a reachable call to panic or a failing assert.

