By default, Kani only reports failures, not how the failure happened. This is because, in its full generality, understanding how a failure happened requires exploring a full (potentially large) execution trace. Here, we've just got some nondeterministic inputs up front, but that's something of a special case that has a "simpler" explanation (just the choice of nondeterministic input). To see traces, run: kani --visualize src/lib.rs
open report/html/index.html The first command runs Kani and generates the html-based report in report/. The second command opens that report in your default browser (on mac, on linux desktops try xdg-open). From this report, we can find the trace of the failure and filter through it to find the relevant line (at present time, an unfortunate amount of generated code is present in the trace): let x: u32 = kani::any();
x = 1023u Here we're seeing the line of code and the value assigned in this particular trace. Like property testing, this is just one example of a failure. To find more, we'd presumably fix this issue and then re-run Kani.

