It seems a bit odd that we can take billions of inputs, but our function clearly only handles up to a few thousand. Let's codify this fact about our function by asserting some reasonable bound on our input, after we've fixed our bug: fn estimate_size(x: u32) -> u32 { assert!(x < 4096); if x < 256 { if x < 128 { return 1; } else { return 3; } } else if x < 1024 { if x > 1022 { return 4; } else { return 5; } } else { if x < 2048 { return 7; } else { return 9; } }
} Now we have stated our previously implicit expectation: this function should never be called with inputs that are too big. But if we attempt to verify this, we get a problem: ** Results:
./src/final_form.rs function estimate_size
[estimate_size.assertion.1] line 3 assertion failed: x < 4096: FAILURE ** 1 of 1 failed (2 iterations)
VERIFICATION FAILED We intended this to be a precondition of calling the function, but Kani is treating it like a failure. If we call this function with too large of a value, it will crash with an assertion failure. But we know that, that was our intention. This is the purpose of proof harnesses . Much like property testing (which would also find this assertion failure as a bug), we need to set up our preconditions, call the function in question, then assert our post conditions. Here's a revised example of the proof harness, one that now succeeds: #[cfg(kani)]
#[kani::proof]
fn verify_success() { let x: u32 = kani::any(); kani::assume(x < 4096); let y = estimate_size(x); assert!(y < 10);
} But now we must wonder if we've really fully tested our function. What if we revise the function, but forget to update the assumption in our proof harness to cover the new range of inputs? Fortunately, Kani is able to report a coverage metric for each proof harness. Try running: kani --visualize src/final_form.rs --function verify_success
open report/html/index.html The beginning of the report includes coverage information. Clicking through to the file will show fully-covered lines in green. Lines not covered by our proof harness will show in red. Try changing the assumption in the proof harness to x < 2048. Now the harness won't be testing all possible cases. Rerun kani --visualize on the file Look at the report: you'll see we no longer have 100% coverage of the function.

