Consider a different variant on the above function: fn get_wrapped(i: usize, a: &[u32]) -> u32 { return a[i % a.len()];
} We've corrected the out-of-bounds access, but now we've omitted the "base case": what to return on an empty list. Kani will spot this not as a bound error, but as a mathematical error: on an empty list the modulus operator (%) will cause a division by zero. Exercise: Try to run Kani on the above, to see what this kind of failure looks like. Rust also performs runtime safety checks for integer overflows, much like it does for bounds checks. Consider this code (from src/overflow.rs): fn simple_addition(a: u32, b: u32) -> u32 { return a + b;
} A trivial function, but if we write a property test for it, we immediately find inputs where it fails, thanks to Rust's dynamic checks. Kani will find these failures as well. Here's the output from Kani: # kani src/overflow.rs
[...]
** Results:
./src/overflow.rs function simple_addition
[simple_addition.assertion.1] line 6 attempt to compute `move _3 + move _4`, which would overflow: FAILURE
[simple_addition.overflow.1] line 6 arithmetic overflow on unsigned + in var_3 + var_4: FAILURE ** 2 of 2 failed (2 iterations)
VERIFICATION FAILED Notice the two failures: the Rust-inserted overflow check (simple_addition.assertion.1) and Kani's explicit overflow check (simple_addition.overflow.1). NOTE: You could attempt to fix this issue by using Rust's alternative mathematical functions with explicit overflow behavior. For instance, instead of a + b write a.wrapping_add(b). However, at the present time , while this disables the dynamic assertion that Rust inserts, it does not disable the additional Kani overflow check. As a result, this currently still fails in Kani.

