Let's say you are developing an inventory management tool, and you would like to verify that your API to manage items is correct. Here is a simple implementation of this API: use std::num::NonZeroU32;
use vector_map::VecMap; type ProductId = u32; pub struct Inventory { inner: VecMap<ProductId, NonZeroU32>,
} impl Inventory { pub fn update(&mut self, id: ProductId, new_quantity: NonZeroU32) { self.inner.insert(id, new_quantity); } pub fn get(&self, id: &ProductId) -> Option<NonZeroU32> { self.inner.get(id).cloned() }
} Now we would like to verify that no matter which combination of id and quantity, that a call to Inventory::update() followed by a call to Inventory::get() using the same id returns some value that is equal to the one we inserted: #[kani::proof] pub fn safe_update() { // Create inventory variable. let mut inventory = Inventory { inner: VecMap::new() }; // Create non-deterministic variables for id and quantity. let id: ProductId = kani::any(); let quantity: NonZeroU32 = kani::any(); assert!(quantity.get() != 0, "NonZeroU32 is internally a u32 but it should never be 0."); // Update the inventory and check the result. inventory.update(id.clone(), quantity); assert!(inventory.get(&id).unwrap() == quantity); } In this harness, we usekani::any() to generate ProductId and the new quantity. kani::any() is a safe API function, and it represents only valid values. If we run this example, Kani verification will succeed, including the assertion that shows that the underlying u32 variable used to represent NonZeroU32 cannot be zero, per its type invariant: You can try it out by running the example under arbitrary-variables directory : cargo kani --function safe_update

