Now you would like to add a new structure to your library that allow users to represent a review rating, which can go from 0 to 5 stars. Let's say you add the following implementation: #[derive(Copy, Clone)]
pub struct Rating { value: u8,
} impl Rating { pub fn from(value: u8) -> Option<Rating> { if value <= 5 { Some(Rating { value }) } else { None } } pub fn get(&self) -> u8 { self.value }
} The easiest way to allow users to create nondeterministic variables of the Rating type which represents values from 0-5 stars is by implementing the kani::Invariant trait. The implementation only requires you to define a check to your structure that returns whether its current value is valid or not. In our case, we have the following implementation: unsafe impl kani::Invariant for Rating { fn is_valid(&self) -> bool { self.value <= 5 } } Now you can use kani::any() to create valid nondeterministic variables of the Rating type as shown in this harness: #[kani::proof] pub fn check_rating() { let rating = kani::any::<Rating>(); assert!(rating.get() <= 5); assert!(Rating::from(rating.get()).is_some()); } You can try it out by running the example under docs/src/tutorial/arbitrary-variables : cargo kani --function check_rating
